   "source": [
    "library(ggplot2)\n",
    "library(dplyr)\n",
    "\n",
    "# Function to prepare data\n",
    "prepare_data <- function(data, label) {\n",
    "  title_words <- strsplit(tolower(data$title), \"\\\\W+\") %>%\n",
    "    unlist() %>%\n",
    "    {.[! . %in% c(\"a\", \"an\", \"and\", \"the\", \"of\", \"in\", \"for\", \"on\", \"at\", \"with\", \"by\", \"to\")]}\n",
    "  \n",
    "  word_freq <- table(title_words)\n",
    "  sorted_word_freq <- sort(word_freq, decreasing = TRUE)\n",
    "  top_20_words <- head(sorted_word_freq, 20)\n",
    "  \n",
    "  data_frame <- data.frame(word = names(top_20_words), frequency = as.numeric(top_20_words))\n",
    "  data_frame$label <- label\n",
    "  return(data_frame)\n",
    "}\n",
    "\n",
    "# Filter data for fraudulent and non-fraudulent posts\n",
    "fraudulent_posts <- df[df$fraudulent == \"t\", ]\n",
    "non_fraudulent_posts <- df[df$fraudulent == \"f\", ]\n",
    "\n",
    "# Prepare data for both fraudulent and non-fraudulent posts\n",
    "word_freq_df_fraud <- prepare_data(fraudulent_posts, \"Fraudulent\")\n",
    "word_freq_df_non_fraud <- prepare_data(non_fraudulent_posts, \"Non-Fraudulent\")\n",
    "\n",
    "# Combine the datasets\n",
    "word_freq_df_combined <- rbind(word_freq_df_fraud, word_freq_df_non_fraud)\n",
    "\n",
    "# Create a combined plot with facets\n",
    "ggplot(word_freq_df_combined, aes(x = reorder(word, frequency), y = frequency, fill = label)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(title = \"Top 20 Most Frequent Words in Job Titles\", subtitle = \"Comparison between Fraudulent and Non-Fraudulent Job Postings\",\n",
    "       x = \"Word\", y = \"Frequency\") +\n",
    "  facet_wrap(~ label, scales = \"free_x\") +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1), legend.position = \"bottom\")\n"
   ]
  },
