    "# Filter word frequency data for fraudulent job postings\n",
    "fraud_word_freq <- word_freq_df_fraud\n",
    "\n",
    "# Generate word cloud for fraudulent job postings\n",
    "wordcloud(words = fraud_word_freq$word, freq = fraud_word_freq$frequency, \n",
    "          max.words = 20, random.order = FALSE, colors = brewer.pal(8, \"Dark2\"))\n",
    "\n",
    "# Add title and subtitle\n",
    "title(\"Word Cloud of Job Titles for Fraudulent Postings\")\n",
    "mtext(\"Top 20 Most Frequent Words\", side = 3, line = 0.5)\n"
   ]
