    "    {.[! . %in% c(\"a\", \"an\", \"and\", \"the\", \"of\", \"in\", \"for\", \"on\", \"at\", \"with\", \"by\", \"to\", \"their\", \"url_921b06bd19182411a4b5c452cf459eb5bbed775def9a0ce28c6396708ac09772\") & nchar(.) > 4]}\n",
    "  \n",
    "  word_freq_profile <- table(profile_words)\n",
    "  sorted_word_freq_profile <- sort(word_freq_profile, decreasing = TRUE)\n",
    "  top_20_words_profile <- head(sorted_word_freq_profile, 20)\n",
    "  \n",
    "  data_frame_profile <- data.frame(word = names(top_20_words_profile), frequency = as.numeric(top_20_words_profile))\n",
    "  data_frame_profile$label <- label\n",
    "  return(data_frame_profile)\n",
    "}\n",
    "\n",
    "# Prepare data for both fraudulent and non-fraudulent posts\n",
    "profile_word_freq_df_fraud <- prepare_profile_data(fraudulent_posts, \"Fraudulent\")\n",
    "profile_word_freq_df_non_fraud <- prepare_profile_data(non_fraudulent_posts, \"Non-Fraudulent\")\n",
    "\n",
    "# Combine the datasets\n",
    "profile_word_freq_df_combined <- rbind(profile_word_freq_df_fraud, profile_word_freq_df_non_fraud)\n",
    "\n",
    "# Create a combined plot with facets\n",
    "ggplot(profile_word_freq_df_combined, aes(x = reorder(word, frequency), y = frequency, fill = label)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(title = \"Top 20 Most Frequent Words in Company Profile Column\", subtitle = \"Comparison between Fraudulent and Non-Fraudulent Job Postings\",\n",
    "       x = \"Word\", y = \"Frequency\") +\n",
    "  facet_wrap(~ label, scales = \"free_x\") +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1), legend.position = \"bottom\")\n"
   ]
