    "prepare_profile_data <- function(data) {\n",
    "  # Split text into words, convert to lowercase, and filter out common stop words\n",
    "  profile_words <- strsplit(tolower(data$company_profile), \"\\\\W+\") %>%\n",
    "    unlist() %>%\n",
    "    {.[! . %in% c(\"a\", \"an\", \"and\", \"the\", \"of\", \"in\", \"for\", \"on\", \"at\", \"with\", \"by\", \"to\", \"their\", \"url_921b06bd19182411a4b5c452cf459eb5bbed775def9a0ce28c6396708ac09772\") & nchar(.) > 4]}\n",
    "  \n",
    "  # Create a table of word frequencies\n",
    "  word_freq_profile <- table(profile_words)\n",
    "  \n",
    "  return(word_freq_profile)\n",
    "}\n",
    "# Assuming fraudulent_posts and non_fraudulent_posts are your data frames\n",
    "profile_word_freq_fraud <- prepare_profile_data(fraudulent_posts)\n",
    "profile_word_freq_non_fraud <- prepare_profile_data(non_fraudulent_posts)\n",
    "# Set color palettes\n",
    "palette_fraud <- brewer.pal(8, \"Reds\")\n",
    "palette_non_fraud <- brewer.pal(8, \"Blues\")\n",
    "\n",
    "# Plot word cloud for fraudulent posts\n",
    "wordcloud(names(profile_word_freq_fraud), \n",
    "          profile_word_freq_fraud, \n",
    "          scale = c(4, 0.5), \n",
    "          max.words = 100, \n",
    "          colors = palette_fraud,\n",
    "          main = \"Word Cloud for Fraudulent Job Postings\")\n",
    "\n",
    "# Plot word cloud for non-fraudulent posts\n",
    "wordcloud(names(profile_word_freq_non_fraud), \n",
    "          profile_word_freq_non_fraud, \n",
    "          scale = c(4, 0.5), \n",
    "          max.words = 100, \n",
    "          colors = palette_non_fraud,\n",
    "          main = \"Word Cloud for Non-Fraudulent Job Postings\")\n"
   ]
  },
