   "source": [
    "library(ggplot2)\n",
    "library(dplyr)\n",
    "\n",
    "# Function to prepare data\n",
    "prepare_experience_data <- function(data, label) {\n",
    "  # Replace missing values with \"null\" in the 'required_experience' column\n",
    "  data$required_experience[is.na(data$required_experience) | data$required_experience == \"\"] <- \"null\"\n",
    "  \n",
    "  # Count the occurrences of each unique value in the 'required_experience' column\n",
    "  experience_counts <- table(data$required_experience)\n",
    "  \n",
    "  # Convert the table to a data frame\n",
    "  experience_df <- data.frame(experience = names(experience_counts),\n",
    "                              count = as.numeric(experience_counts))\n",
    "  \n",
    "  # Sort the data frame by count in descending order\n",
    "  experience_df <- experience_df[order(-experience_df$count), ]\n",
    "  \n",
    "  # Add label column\n",
    "  experience_df$label <- label\n",
    "  \n",
    "  return(experience_df)\n",
    "}\n",
    "\n",
    "# Prepare data for fraudulent and non-fraudulent posts\n",
    "experience_df_fraud <- prepare_experience_data(fraudulent_posts, \"Fraudulent\")\n",
    "experience_df_non_fraud <- prepare_experience_data(non_fraudulent_posts, \"Non-Fraudulent\")\n",
    "\n",
    "# Combine the datasets\n",
    "experience_df_combined <- rbind(experience_df_fraud, experience_df_non_fraud)\n",
    "\n",
    "# Visualize the results with a bar plot\n",
    "ggplot(experience_df_combined, aes(x = reorder(experience, count), y = count, fill = label)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(title = \"Most Repeated Required Experience for Job Postings\",\n",
    "       subtitle = \"Comparison between Fraudulent and Non-Fraudulent Job Postings\",\n",
    "       x = \"Experience\", y = \"Count\") +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1), legend.position = \"bottom\")\n"
   ]
